import '../../Css/Main.css';
import {Link} from 'react-router-dom';
import React, { useState, useEffect } from 'react';

function Header() {
    const [isLogin, setIsLogin] = useState(false); //로그인 관리


  useEffect(() => {
    if (sessionStorage.getItem("id") === null) {
      // sessionStorage 에 name 라는 key 값으로 저장된 값이 없다면
      console.log("isLogin ?? :: ", isLogin);
    } else {
      // sessionStorage 에 name 라는 key 값으로 저장된 값이 있다면
      // 로그인 상태 변경
      setIsLogin(true);
      console.log("isLogin ?? :: ", isLogin);
    }
  });

  return (
    <div>
      <div id="header">
          <div id="header_top">
              <div class="headerTop_content">
                  <Link to="/register" class="member">회원가입</Link>
                  <div class="barIcon">|</div>
                  {isLogin ? (
                    <Link to={"/mypage"} class="login">
                        {sessionStorage.getItem("id")}
                        </Link>
                        ) : (
                        <Link to={"/login"} class="login">로그인
                        </Link>
                        )}

                  <div class="barIcon">|</div>
                  <div class="service">고객센터</div>
                  <div id="arrow">
                      <div class="arrow-down"></div>
                  </div>
              </div>
          </div>

          <div id="header_wrap">
              <div class="header_content1">
                  <Link to="/" class="loco">95창고</Link>
              </div>
              <div class="header_content2">
                  <input class="search_box" placeholder="검색어를 입력해주세요"></input>
                  <div class="search">
                      <img src="data:image/svg+xml;base64,"></img>
                  </div>
              </div>
              <div class="header_content3">
                  <img class="icon address" src="data:image/svg+xml;base64,"></img>
                  <img class="icon like" src="data:image/svg+xml;base64,"></img>
                  <img class="icon basket" src="data:image/svg+xml;base64,"></img>
              </div>
          </div>
      </div>
    </div> 
  );
}

export default Header;
